import { FC } from "react";
import { useKeyboardForm } from "../../lib/keyboardFormStore";
import { Flex } from "@rsbear/betsy";

const StepOne: FC<any> = () => {
  const { values, setString } = useKeyboardForm();

  return (
    <div>
      <p>name & brand</p>
      <Flex>
        <input
          type="text"
          placeholder="Name"
          name="name"
          value={values.name}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="brand"
          name="brand"
          value={values.brand}
          onChange={(e) => setString(e)}
        />
      </Flex>

      <Flex>
        <input
          type="text"
          placeholder="size"
          name="size"
          value={values.size}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="mount"
          name="mount"
          value={values.mount}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="typing angle"
          name="angle"
          value={values.angle}
          onChange={(e) => setString(e)}
        />
      </Flex>

      <Flex>
        <input
          type="text"
          placeholder="connection"
          name="connection"
          value={values.connection}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="pcb"
          name="pcb"
          value={values.pcb}
          onChange={(e) => setString(e)}
        />
        <input
          type="text"
          placeholder="firmware"
          name="firmware"
          value={values.firmware}
          onChange={(e) => setString(e)}
        />
      </Flex>

      <p>do you want to provide colors</p>
    </div>
  );
};

export default StepOne;
